function NavContainer(props) {
    return <div

        className = "container-fluid"

    ><a className="navbar-brand" href="#"> <img src="/docs/5.0/assets/brand/bootstrap-logo.svg" alt="" width="30" height="24" class="d-inline-block align-top"/>  Personal F.M </a></div>
}


function NavBar(props) {

    if(props.loggedIn) {

        return <div

            className = "navbar navbar-expand-lg navbar-light bg-light"

        >

            <NavContainer />

        </div>

    }

    return <h1>You are not logged in</h1>

}


export default NavBar;
